import "./App.css";
import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      operator: "",
      firstNumber: 0,
      secondNumber: 0,
      currVal: "",
      temp: 0,
    };
  }

  operations(props) {
    let op = ["*", "-", "+", "/"];
    if (op != props && temp == 0){
      this.setState({
        firstNumber: this.state.currVal + props,
      });
    }
    else if( props in op){
      console.log(props)
      this.setState({
        operator: props,
      });

    }


    }


  render() {
    return (
      <div className="App">
        <br />
        <p>Calculator</p>
        <br />
        <br />
        {this.state.currVal}
        <br />
        <br />
        <br />
        <button
          onClick={() => {
            this.operations("1");
          }}
        >
          1
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("2");
          }}
        >
          2
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("3");
          }}
        >
          3
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations(" + ");
          }}
        >
          +
        </button>{" "}
        <t />
        <br />
        <br />
        <button
          onClick={() => {
            this.operations("4");
          }}
        >
          4
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("5");
          }}
        >
          5
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("6");
          }}
        >
          6
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations(" - ");
          }}
        >
          -
        </button>{" "}
        <t />
        <br />
        <br />
        <button
          onClick={() => {
            this.operations("7");
          }}
        >
          7
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("8");
          }}
        >
          8
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("9");
          }}
        >
          9
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations(" * ");
          }}
        >
          *
        </button>{" "}
        <t />
        <br />
        <br />
        <button
          onClick={() => {
            this.operations("C");
          }}
        >
          C
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations("0");
          }}
        >
          0
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations(".");
          }}
        >
          .
        </button>{" "}
        <t />
        <button
          onClick={() => {
            this.operations(" / ");
          }}
        >
          /
        </button>{" "}
        <t />
        <br />
        <br />
        <button
          onClick={() => {
            this.operations("=");
          }}
        >
          =
        </button>{" "}
        <t />
      </div>
    )
  };

}
export default App;
